// console.log (this.url + this.cTim + ".js");
		var req = this.http.get(this.url + this.cTim + ".js", this.utLzr.bind(this, function (rsp) {
// console.log (rsp.statusCode);
			if (rsp.statusCode === 200) {
				var json = "";
